import React from "react";
import Login from "./Pages/login";
import { Route, Switch } from "react-router-dom";

const Router = () => {
  return (
    <div className="App">
      <Switch>
        <Route path="/login" render={Login} />
        <Route />
      </Switch>
    </div>
  );
};

export default Router;
